import { BrowserRouter, Route } from "react-router-dom";
import Navbar from './component/Home/Header/';
import Home from "./component/Home/Home";


function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Home />
    </BrowserRouter>
  );
}

export default App;
